import React from 'react'
import styled from 'styled-components'

const AboutContainer = styled.section`
    Display:flex;
    height:100vh;
    @media (max-width: 45em) {
        flex-direction:column;
    }
`

const ImageContainer = styled.section`
    height:100%;
    width:50%;
    background: linear-gradient(90deg, var(--primary) 30%, white 10em);
    @media (max-width: 45em) {
        width:100%;
        height:50%
    }
`

const TextContainer = styled.section`
    height:100%;
    width:50%;
    Display:flex;
    background: grey;
    @media (max-width: 45em) {
        width:100%;
        height:50%
    }
`

const Image = styled.image``

const Title = styled.h1``

const Text = styled.p``


export default function About() {
    return (
        <AboutContainer>
            <ImageContainer>
                <Image src=""/>
            </ImageContainer>
            <TextContainer>
                <Title>
                </Title>
                <Text>
                </Text>
            </TextContainer>
        </AboutContainer>
    )
}
